import React, { Component } from 'react';
import { Container, Header, Content, Form, Item, Picker } from 'native-base';
export default class PickerInputExample extends Component {
    constructor(props) {
    super(props);
    this.state = {
      selected2: undefined
    };
  }
  onValueChange2(value: string) {
    this.setState({
      selected2: value
    });
  }
  render() {
    return (
      <Container>

        <Content>
          <Form>
            <Item picker>
              <Picker
                mode="dropdown"
                //iosIcon={<Icon name="arrow-down" />}
                style={{ width: undefined }}
                placeholder="Select Ubication"
                placeholderStyle={{ color: "#bfc6ea" }}
                placeholderIconColor="#007aff"
                selectedValue={this.state.selected2}
                onValueChange={this.onValueChange2.bind(this)}
              >
                <Picker.Item label="Mexico" value="key0" />
                <Picker.Item label="USA" value="key1" />
                <Picker.Item label="China" value="key2" />
                <Picker.Item label="Brazil" value="key3" />
                <Picker.Item label="Rusia" value="key4" />
              </Picker>
            </Item>
          </Form>
        </Content>
      </Container>
    );
  }
}
